import logo from './logo.svg';
import './App.css';

import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Button,
  Box,
} from "@material-ui/core";
import MenuIcon from '@material-ui/core/Menu';

function App() {
  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <div>Home Page</div>
      </AppBar>
    </Box>
  );
}

export default App;
